namespace RonSijm.FluidHumidifier.Factories.Pinpoint;

public class CampaignFactory(string resourceName = null, Action<Humidifier.Pinpoint.Campaign> factoryAction = null) : ResourceFactory<Humidifier.Pinpoint.Campaign>(resourceName)
{

    internal List<InnerCampaignWriteTreatmentResourceFactory> AdditionalTreatmentsFactories { get; set; } = [];

    internal InnerCampaignTemplateConfigurationFactory TemplateConfigurationFactory { get; set; }

    internal InnerCampaignMessageConfigurationFactory MessageConfigurationFactory { get; set; }

    internal InnerCampaignLimitsFactory LimitsFactory { get; set; }

    internal InnerCampaignScheduleFactory ScheduleFactory { get; set; }

    internal InnerCampaignCustomDeliveryConfigurationFactory CustomDeliveryConfigurationFactory { get; set; }

    internal InnerCampaignCampaignHookFactory CampaignHookFactory { get; set; }

    protected override Humidifier.Pinpoint.Campaign Create()
    {
        var campaignResult = CreateCampaign();
        factoryAction?.Invoke(campaignResult);

        return campaignResult;
    }

    private Humidifier.Pinpoint.Campaign CreateCampaign()
    {
        var campaignResult = new Humidifier.Pinpoint.Campaign
        {
            GivenName = InputResourceName,
        };

        return campaignResult;
    }
    public override void CreateChildren(Humidifier.Pinpoint.Campaign result)
    {
        base.CreateChildren(result);

        result.AdditionalTreatments = AdditionalTreatmentsFactories.Any() ? AdditionalTreatmentsFactories.Select(x => x.Build()).ToList() : null;
        result.TemplateConfiguration ??= TemplateConfigurationFactory?.Build();
        result.MessageConfiguration ??= MessageConfigurationFactory?.Build();
        result.Limits ??= LimitsFactory?.Build();
        result.Schedule ??= ScheduleFactory?.Build();
        result.CustomDeliveryConfiguration ??= CustomDeliveryConfigurationFactory?.Build();
        result.CampaignHook ??= CampaignHookFactory?.Build();
    }

} // End Of Class

